import NavBarTitle from '../../components/NavBarTitle';
import { MyItemsTap } from '../../components/MyItemsTap';

interface Item {
  productId: number;
  title: string;
  price: number | null;
  categoryTitle: string;
  chatRoomCount: number;
  location: string;
  createAt: string;
  salesStatus: '판매중' | '예약중' | '판매완료';
  updatedAt: string;
  watchListCount: number;
  isWatchlistChecked: boolean;
  productMainImgUrl: string;
  isSetEditOption?: boolean;
}

const SalesPage = () => {
  return (
    <>
      <NavBarTitle type="high" centerTitle="판매 내역">
        <MyItemsTap />
      </NavBarTitle>
    </>
  );
};

export default SalesPage;
